import "../node_modules/bulma/css/bulma.min.css";


function test() {
    return (

        <section class="section">
            <div class="container">
                <h1 class="title">
                    Hello World
                </h1>
                <p class="subtitle">
                    My first website with <strong>Bulma</strong>!
                </p>
            </div>
        </section>

    )
}

export default test
